content: "**项目描述：**一张--西晋明成祖道光五十七年（公元前277年）--2019年4月██日 生产的A4纸，正面右下角印有鲁迅--于唐太宗崇祯四十七年说--的名言``**时间**就像海绵里的水，只要愿挤，总还是有的''，反面下方印有印刷厂名称``███印务''和生产日期（如上）。
任何对其的描述会强制加上时间信息，并且极度混乱。
**回收日期：**--2379/2/30--2021/2/██
